import styles from "./app.module.css";
import { data } from "../../utils/data";

function timer() {
  const time = new Date().toLocaleTimeString();
  console.log(time);
  return <p>{time}</p>;
}



function App() {
  return (
    <div className={styles.sqare}>
      <div className={styles.ss}>{setInterval(timer, 1000)}</div>
    </div>
  );
}

export default App;
